To slow down the animation, you can use GSAP's `timeScale` property. Here's how you can modify your code to run the animation once every 0.6 seconds:

```jsx
import { useRef, useEffect } from 'react';
import gsap from 'gsap';

const Portfolio = () => {
  const tl = gsap.timeline();
  const portfolioCurrent = useRef(null);
  const portfolioNext = useRef(null);
  const cursor = { cursorImage: 'url(cursor.png)' };

  useEffect(() => {
    let timer;

    const runAnimation = () => {
      tl.set(portfolioCurrent.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
      });
      tl.set(portfolioCurrent.current, {
        css: { backgroundImage: `url(${cursor.cursorImage})` },
      });

      tl.to(portfolioCurrent.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
        duration: 0.5,
      }, 'start');

      tl.to(portfolioNext.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
        delay: 0.1,
        duration: 0.5,
      }, 'start');

      tl.set(portfolioCurrent.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
      });

      tl.set(portfolioCurrent.current, {
        css: { backgroundImage: `url(${cursor.cursorImage})` },
      });

      tl.timeScale(0.6); // set timeScale to 0.6 to slow down the animation
      tl.play();
    };

    timer = setTimeout(runAnimation, 600); // run the animation every 0.6 seconds

    // clean up the timer when the component unmounts
    return () => clearTimeout(timer);
  }, [cursor.cursorImage]);

  return (
    <div>
      <div ref={portfolioCurrent} />
      <div ref={portfolioNext} />
    </div>
  );
};

export default Portfolio;
```

In this code, I've added a `timer` variable that uses `setTimeout` to run the animation every 0.6 seconds. The `runAnimation` function is called when the component mounts, and it sets the `timeScale` of the timeline to 0.6 to slow down the animation. The `clearTimeout` function is used to clean up the timer when the component unmounts.

