Shopify does not have a built-in API for currency conversion. However, you can use third-party APIs like Open Exchange Rates or Google Cloud Translation API to handle currency conversion in your Shopify store.

Here's a basic example of how you can use Open Exchange Rates API in a Shopify script:

1. First, sign up for a free API key at https://openexchangerates.org/

2. In your Shopify admin, go to Apps > Manage private apps > Create a new private app > Set the admin API access level to Read and write data > Save.

3. Create a new script in your Shopify theme (e.g., `assets/js/currency-converter.js`).

4. In the script, include your API key and make a request to the Open Exchange Rates API to get the exchange rate between the store's base currency and the target currency:

```javascript
const axios = require('axios');

const apiKey = 'YOUR_API_KEY';
const baseCurrency = 'USD'; // Shopify's base currency
const targetCurrency = 'EUR'; // The currency you want to convert to

axios.get(`https://openexchangerates.org/api/latest.json?app_id=${apiKey}`)
  .then(response => {
    const exchangeRate = response.data.rates[targetCurrency] / response.data.rates[baseCurrency];
    console.log(`Exchange rate: ${exchangeRate}`);
  })
  .catch(error => {
    console.error(error);
  });
```

5. To use this script in your theme, add the following line to your `theme.liquid` file:

```liquid
{% include 'currency-converter' %}
```

6. Don't forget to compile your assets:

```sh
shopify cli theme:watch
```

