	ipsMap   = make(map[string][]string)
	ipsMutex = sync.Mutex{}
)

func handleRequest(w dns.ResponseWriter, r *dns.Msg) {
	m := new(dns.Msg)
	m.SetReply(r)

	for _, q := range r.Question {
		ipsMutex.Lock()
		ips, found := ipsMap[q.Name]
		ipsMutex.Unlock()

		if !found {
			ips = []string{}
			ipsMutex.Lock()
			ips = forwardDNS(q.Name)
			ipsMutex.Unlock()
		}

		var answers []dns.RR
		for _, ip := range ips {
			answers = append(answers, &dns.A{
				Hdr: dns.RR_Header{
					Name:   q.Name,
					Rrtype: dns.TypeA,
					Class:  dns.ClassINET,
					Ttl:    300,
